import React from 'react';
import List from './List'
import store from './store';


function App(props) {
  const list = props.store.lists.map(list=> {
   return {
    header: list.header,
    card: list.card
    };
  });

  return (
    <main className='App'>
      <header class="App-header">
        <h1>Trelloyes!</h1>
      </header>
      <div class="App-list">
        <List props={list}/>      
      </div>
    </main>
  );
}

export default App;
